I'm not sure if this is a good idea or not, but I'll leave it up to you. If we do decide that this is a bad idea, feel free to close the PR.

The reason why I think this might be a bad idea is because there's no way of knowing how much memory will be used by an object. For example:

```js
const obj = { foo: 'bar' };
console.log(obj); // {foo: "bar"}
obj.foo = 42;
console.log(obj);
// {foo: 42, bar: undefined}
```

In this case, `obj` has two properties (`foo` and `bar`) even though only one property was added (the `foo` property). This means that adding another property would result in more than twice as many bytes being allocated on the heap. In other words, the amount of memory required to store an object can change over time depending on what values are assigned to its properties.

That said, I don't know enough about JavaScript internals to say whether or not this is actually a problem. It could very well just be an implementation detail.
