The datatype of a variable determines what kind of values it can hold and how they will be interpreted by the program.

For example:
int x = 10;
float y = 3.14;
string name = "John";
boolean isStudent = true;

In this case, `x` holds an integer value, `y` holds a floating-point value, `name` holds a string value, and `isStudent` holds a boolean value. Each of these datatypes has its own set of rules for how it should be used and stored in memory.

It's important to choose the correct datatype when declaring variables so that your program runs correctly and efficiently. If you accidentally declare a variable with the wrong datatype, your program may not work as expected or could even crash entirely.

